(558, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Happy Dussehra! \r\n\r\nToday, we celebrate Dussehra, also known as Vijayadashami, a festival that marks the victory of good over evil, light over darkness, and truth over falsehood. \r\n\r\nThis day commemorates Lord Rama\'s victory over Ravana, symbolizing that no matter how powerful evil seems, truth and righteousness will always prevail. \r\n\r\nAcross India, vibrant celebrations unfold:\r\n Ramlila performances bringing the Ramayana to life,\r\n Effigies of Ravana, Meghnad, and Kumbhkaran set ablaze to signify the burning away of negativity,\r\n Families and communities coming together to celebrate unity and hope.\r\n\r\nAs we witness the flames rise high, lets also burn the Ravana within us  anger, ego, hatred, and greed  and welcome a life filled with kindness, humility, and compassion. \r\n\r\nDussehra reminds us that every challenge can be overcome with courage, faith, and perseverance.\r\nLet this day inspire you to take a step toward victory in your own life, whether personal or professional. \r\n\r\n What negativity are you ready to let go of this Dussehra? Share with us below!\r\n\r\n#HappyDussehra #Vijayadashami #GoodOverEvil #FestivalOfFaith #Positivity #Ramlila #DussehraCelebration', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQErk_8yPkJHDQ/feedshare-shrink_800/B56ZmjY1oKHQAk-/0/1759382822589?e=1762387200&v=beta&t=EDJAby_tsPbFysclnjwNwCjVSXt6D3MkYrKal7ULFK4', 'urn:li:share:7379386415601676288', 'linkedin', 'API', '51e82e91-739b-4dd4-99b0-e8300c59a480', 3, 0, 0, 0.26666666666666666, '27', '15', '2025-10-02', '1', '2025-10-06 12:20:42', '2025-10-06 12:20:42'),
(559, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri 2025 Concludes with Gratitude \r\n\r\nAs these nine sacred nights come to a close, lets reflect on the divine blessings and lessons Maa Durga has bestowed upon us. \r\n\r\nMay the spirit of courage, devotion, and positivity guide us every day, helping us overcome challenges and embrace new beginnings. \r\n\r\n What was your most special Navratri moment this year? Share with us in the comments!\r\n\r\n#Navratri2025 #MaaDurgaBlessings #Gratitude #FestivalOfFaith #GoodOverEvil #SpiritualJourney #Positivity', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQFj9gv260MU1w/feedshare-shrink_1280/B56Zmerpz1IYAs-/0/1759303868687?e=1762387200&v=beta&t=Yc3tT-1ggqVLa7t1gNAt8YvtnKwnMG88LGFG7MiCuXk', 'urn:li:share:7379055255671640064', 'linkedin', 'API', 'e937a862-6d52-42c1-84a4-455b2ccdc7b3', 4, 0, 0, 0.42391304347826086, '28', '13', '2025-10-01', '1', '2025-10-06 12:20:42', '2025-10-06 12:20:42'),
(560, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 9  Celebrating Maa Siddhidatri \r\n\r\nOn the final day of Navratri, we bow to Maa Siddhidatri, the divine mother who blesses her devotees with spiritual wisdom and fulfillment. \r\n\r\nMay her grace remove ignorance and fill your life with clarity, peace, and prosperity. \r\n\r\n Offer fruits, sesame seeds, and sweets today to seek her divine blessings.\r\n\r\n Mantra: Om Devi Siddhidatryai Namah\r\n\r\n As Navratri concludes, may we carry forward the values of strength, faith, and devotion into our lives each day. \r\n\r\n#Navratri2025 #Day9 #MaaSiddhidatri #SpiritualGrowth #PeaceAndProsperity #FestivalOfFaith #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQHgqb3ZRsvAYA/feedshare-shrink_800/B56ZmeNpwoIAAg-/0/1759296004433?e=1762387200&v=beta&t=r0bTQwyDD2yTLd8tkDSF2ikxlHjGybN8U2ex-uMllM8', 'urn:li:share:7379022280321970176', 'linkedin', 'API', '1cb5288b-52d7-46b1-9b19-d06dc7c3fed4', 10, 1, 0, 0.8970588235294118, '21', '6', '2025-10-01', '1', '2025-10-06 12:20:42', '2025-10-06 12:20:42'),
(561, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 8  Celebrating Maa Mahagauri \r\n\r\nToday, we worship Maa Mahagauri, the symbol of purity, peace, and serenity. \r\n\r\nShe blesses her devotees with love, harmony, and liberation from negativity, guiding them towards a life filled with spiritual enlightenment and positivity. \r\n\r\n Offer coconut, white sweets, and milk-based dishes today to seek her divine blessings.\r\n\r\n Mantra: Om Devi Mahagauryai Namah\r\n\r\nMay Maa Mahagauri\'s divine light fill your heart with peace, prosperity, and happiness. \r\n\r\n#Navratri2025 #Day8 #MaaMahagauri #PeaceAndProsperity #FestivalOfFaith #SpiritualVibes #Shakti', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQF4FCIf1q69hA/feedshare-shrink_800/B56ZmZSP8KI4Ag-/0/1759213324728?e=1762387200&v=beta&t=MQtr4kKPNGDmg1m-K5S7na1QUngOyGtEMKOHOKgC4E0', 'urn:li:share:7378675508345044992', 'linkedin', 'API', '3ecad0c7-02e8-481c-8c0a-fe0cbc4a8f98', 2, 1, 0, 0.4444444444444444, '38', '15', '2025-09-30', '1', '2025-10-06 12:20:42', '2025-10-06 12:20:42'),
(562, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 7  Worshipping Maa Kaalratri \r\n\r\nToday, we honor Maa Kaalratri, the fierce and protective form of Maa Durga who destroys darkness and negativity. \r\n\r\nThough her form is fearsome, she is lovingly called Shubhankari, as she brings auspiciousness, blessings, and courage to her devotees. \r\n\r\n Offer jaggery or jaggery sweets to Maa Kaalratri today and seek her divine protection.\r\n\r\n Mantra: Om Devi Kaalratryai Namah \r\n\r\nMay her energy fill your life with fearlessness, peace, and strength. \r\n\r\n#Navratri2025 #Day7 #MaaKaalratri #PowerAndProtection #DestroyNegativity #FestivalOfFaith #SpiritualEnergy', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQG0dtWM1jiauw/feedshare-shrink_800/B56ZmOhUXFKAAg-/0/1759032723279?e=1762387200&v=beta&t=4abodI14qT9yDDX7c6Cn0cN8S-uyw-WFbBy8G4v6Hu4', 'urn:li:share:7377917991109394432', 'linkedin', 'API', 'b4f1d75a-9bd6-4e2f-87dc-640c8f43b8df', 2, 1, 0, 1.9456521739130435, '48', '19', '2025-09-28', '1', '2025-10-06 12:20:42', '2025-10-06 12:20:42'),
(563, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 6  Celebrating Maa Katyayani \r\n\r\nToday, we worship Maa Katyayani, the fierce form of Goddess Durga, who blesses us with courage, strength, and protection. \r\n\r\nMay her divine energy remove all negativity and fill your life with peace, love, and victory over challenges. \r\n\r\n Offer yellow flowers and honey today to seek her blessings. \r\n\r\n Mantra: Om Devi Katyayanyai Namah\r\n\r\n Drop a  in the comments if you seek Maa Katyayanis courage and divine strength today! \r\n\r\n#Navratri2025 #Day6 #MaaKatyayani #CourageAndStrength #FestivalOfFaith #SpiritualVibes #NavratriVibes #DivineGrace', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQHI9_hhmDY2dA/feedshare-shrink_800/B56ZmJjKsEKMAg-/0/1758949324752?e=1762387200&v=beta&t=MMRwnseBw1uQJ23OiOV_MJCSt3XqE7f29Zgaw8OAWZw', 'urn:li:share:7377568205457846272', 'linkedin', 'API', '776e2126-986c-4942-a833-41f8d7f8498b', 1, 1, 0, 3.7045454545454546, '23', '6', '2025-09-27', '1', '2025-10-06 12:20:42', '2025-10-06 12:20:42'),
(564, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 5  Celebrating Maa Skandamata \r\n\r\nToday, we worship Maa Skandamata, the symbol of love, strength, and protection, who blesses her devotees with harmony and divine wisdom. \r\n\r\nMay her blessings fill your home with peace, prosperity, and happiness. \r\n\r\n Offer white flowers and bananas today to seek her grace. \r\n\r\n Mantra: Om Devi Skandamatayai Namah\r\n\r\n Drop a  if you seek Maa Skandamatas blessings for your family today! \r\n\r\n#Navratri2025 #Day5 #MaaSkandamata #DivineMother #FamilyBlessings #SpiritualVibes #FestivalOfFaith #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQHjQcsexGBm7A/feedshare-shrink_800/B56ZmEcy3gJoAg-/0/1758863766472?e=1762387200&v=beta&t=JbU2XFYjt2mX1OkUsefoptW3f-nFYcJ2SkqBf_zhO3E', 'urn:li:share:7377209348424388608', 'linkedin', 'API', '4ee5e1c8-38dc-438d-b97f-bea17d91de20', 4, 1, 0, 1.2956989247311828, '52', '15', '2025-09-26', '1', '2025-10-06 12:20:42', '2025-10-06 12:20:42'),
(565, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 4  Celebrating Maa Kushmanda \r\n\r\nToday, we worship Maa Kushmanda, the creator of the universe, who with her divine smile  filled the cosmos with warmth, light, and energy.\r\n\r\nMay her blessings bring health, prosperity, and positivity into your life. \r\n\r\n Offer pumpkin or malpua today to seek her divine grace.\r\n\r\n Mantra: Om Devi Kushmandayai Namah\r\n\r\n Lets embrace the power of creation and spread light wherever we go! \r\n\r\n#Navratri2025 #Day4 #MaaKushmanda #DivineBlessings #FestivalOfFaith #PositiveVibes #SpiritualJourney #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQERensigJ4QhA/feedshare-shrink_800/B56Zl_WKu.J8Ag-/0/1758778144486?e=1762387200&v=beta&t=mGZvT2yk8cV3jqHZmiVs2w01IJqwOTcerxfo4pGv_0Q', 'urn:li:share:7376850215343083520', 'linkedin', 'API', '04215bea-0bc0-4dea-a41b-1e654f8de777', 5, 2, 0, 1.5857843137254903, '78', '24', '2025-09-25', '1', '2025-10-06 12:20:42', '2025-10-06 12:20:42'),
(566, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 3  Celebrating Maa Chandraghanta \r\n\r\nToday, we worship Maa Chandraghanta, the goddess of courage, serenity, and protection. \r\n\r\nShe teaches us to stay calm yet strong, even in the face of difficulties. May her blessings fill our lives with peace, harmony, and positivity. \r\n\r\n Offer kheer, milk, or white-colored sweets to seek her divine grace.\r\n\r\n Mantra: Om Devi Chandraghantayai Namah\r\n\r\n Which Navratri ritual do you enjoy the most? Share in the comments! \r\n\r\n#Navratri2025 #Day3 #MaaChandraghanta #StrengthAndPeace #DivineGrace #FestivalOfFaith #SpiritualJourney #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQEw-1DeO5ciqA/feedshare-shrink_1280/B56Zl6F8MBJ4As-/0/1758690002964?e=1762387200&v=beta&t=pTtbz0pv1jH2vTP5T4_1afouWkwAnVdE_A9iu-JxRFo', 'urn:li:share:7376480516033871873', 'linkedin', 'API', 'f43d8e6d-ac7e-4e2a-a98d-e6e7858b4306', 2, 1, 0, 0.924966261808367, '61', '25', '2025-09-24', '1', '2025-10-06 12:20:42', '2025-10-06 12:20:42'),
(567, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 2  Celebrating Maa Brahmacharini \r\n\r\nToday, we honor Maa Brahmacharini, the goddess of penance and devotion, who guides us on the path of truth and spiritual awakening. \r\n\r\nMay her blessings bring peace, inner strength, and clarity to your life. \r\n\r\n Chant her mantra: Om Devi Brahmacharinyai Namah\r\n\r\n Lets walk together on the path of devotion and wisdom this Navratri! \r\n\r\n#Navratri2025 #Day2 #MaaBrahmacharini #DivineGrace #IndianFestivals #SpiritualVibes #Blessings #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQEKJlBd9OUGTg/feedshare-shrink_800/B56Zl1Drn1I0Ag-/0/1758605526276?e=1762387200&v=beta&t=DFyTc4G-zKWXWXcZ1ydquyEJyBMQyZ1PGr-T-wjomBc', 'urn:li:share:7376126191029669888', 'linkedin', 'API', '7d577b87-e6e2-4e0c-af03-a8c001d2548a', 4, 1, 0, 1.4224025974025973, '68', '26', '2025-09-23', '1', '2025-10-06 12:20:43', '2025-10-06 12:20:43'),
(568, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Shubh Navratri 2025! \n\nToday marks the beginning of Navratri, a nine-day festival that celebrates the victory of good over evil, light over darkness, and positivity over negativity. \n\nEach day of Navratri is dedicated to one form of Goddess Durga, symbolizing strength, courage, wisdom, and prosperity. \n\nAs the dhols beat and the air fills with devotion, let\'s embrace these nine days with:\n Faith to overcome challenges,\n Gratitude for our blessings, and\n Compassion to uplift others.\n\nMay Maa Durga shower her divine blessings on you and your loved ones with happiness, success, and good health. \n\nLets celebrate the spirit of strength, faith, and victory of good over evil. \n\n Share your Navratri wishes or how you celebrate this festival with your family in the comments below!\n\n#Navratri2025 #ShubhNavratri #DurgaMaa #FestivalVibes #GoodOverEvil', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQF1SG3iRlROwQ/feedshare-shrink_800/B56ZlwHW.QH8Ag-/0/1758522602346?e=1762387200&v=beta&t=tKz4-9qRGBIh5DF2zzCZv9j6JoGv_HuhxSSApBVjpBk', 'urn:li:share:7375778394694701056', 'linkedin', 'API', '12abd2f6-e3db-40f8-be58-295c91a13ac9', 2, 0, 0, 2.5211426000899686, '57', '17', '2025-09-22', '1', '2025-10-06 12:20:43', '2025-10-06 12:20:43'),
(569, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' National Sports Day\r\n\r\nToday, we remember a true legend  Major Dhyan Chand, whose passion for hockey made India shine on the world stage. His dedication was so deep that he would practice even at night under the moonlight, which gave him the name Chand. \r\n\r\nFrom winning Olympic golds in 1928, 1932, and 1936, to inspiring generations with his discipline and humility, Major Dhyan Chands story is not just about sports  its about dreams, resilience, and national pride.\r\n\r\nOn this day, lets celebrate the spirit of sports that teaches us to work as a team, rise after every fall, and keep pushing forward with courage. \r\n\r\nHappy National Sports Day!\r\n\r\n#NationalSportsDay #MajorDhyanChand #PrideOfIndia #SportsSpirit #JaiHind', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQGvYuj_80Ix_A/feedshare-shrink_800/B56Zj1VmqpH8Ak-/0/1756462738725?e=1762387200&v=beta&t=gtMZ2aF8EHO7O-NwDldrskv8L1lHQmBX9ki9Y9SlRN0', 'urn:li:share:7367138704718512128', 'linkedin', 'API', '8f00d093-5dcc-4412-9ff2-d8fd0e976976', 4, 0, 0, 0.875, '94', '46', '2025-08-29', '1', '2025-10-06 12:20:43', '2025-10-06 12:20:43'),
(570, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Celebrating Janmashtami 2025 \r\n\r\nToday, as we celebrate the birth of Lord Krishna, we are reminded of the timeless values He stood forwisdom, resilience, compassion, and the courage to choose what is right over what is easy.\r\n\r\nJanmashtami is not just a festival of devotion; its also an inspiration to bring balance in our livesbetween work and growth, success and humility, leadership and service. Just as Krishnas flute symbolizes harmony, may we all create workplaces and communities that thrive on collaboration, trust, and shared purpose.\r\n\r\n Wishing you and your loved ones a joyful Janmashtami filled with positivity, peace, and progress.\r\n\r\n#Janmashtami #Leadership #Inspiration #Celebration', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQE4kReOtTowBg/feedshare-shrink_2048_1536/B56ZixTaxwHQAo-/0/1755321314746?e=1762387200&v=beta&t=r-9ULQ_5TXcQA0n8KUiVmQY543rdvFs1KA8S5XE_6AE', 'urn:li:share:7362351211490000898', 'linkedin', 'API', 'f58cd009-0fef-426f-9ace-3bce9ef8d8ee', 3, 0, 0, 0.6111111111111112, '74', '34', '2025-08-16', '1', '2025-10-06 12:20:43', '2025-10-06 12:20:43'),
(571, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', '  Happy Independence Day 2025!  \r\n\r\nToday, we celebrate 78 years of freedom  a journey built on sacrifice, courage, and unshakable determination. \r\n\r\n The green reminds us of growth, harmony, and progress.\r\n The white stands for peace, truth, and unity.\r\n The saffron inspires us with strength, courage, and resilience.\r\nAnd at the heart of it all, the Ashoka Chakra represents motion, reminding us that a nation moves forward only when its people move forward together. \r\n\r\nThis day is not just a reminder of our past, but a reflection of who we are today  innovators, dreamers, and changemakers determined to shape the India of tomorrow. \r\n\r\nLets honor this freedom by building, contributing, and standing united for a future that reflects the values of our tricolor.\r\n\r\n Jai Hind! \r\n\r\n#AzadiKaAmritMahotsav #IndependenceDay2025 #IndiaAt79 #HappyIndependenceDay #JaiHind #IndianIndependenceDay #IncredibleIndia #ProudIndian #IndependenceDayIndia #IndiaCelebrates #Tricolor #IndianFlag', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQF8To1eySetwA/feedshare-shrink_800/B56ZitmKX1G0Ag-/0/1755259120324?e=1762387200&v=beta&t=2FiLXLVSZgyjSNzWLBsfIfHGjOFTZGVR_7jHsxnOF9o', 'urn:li:share:7362090350334656512', 'linkedin', 'API', '0e38e9f0-cf38-4438-8b05-12baa249707e', 2, 0, 0, 0.7083333333333333, '67', '29', '2025-08-15', '1', '2025-10-06 12:20:43', '2025-10-06 12:20:43');
